const PostsDetail = (props) => {
    const data= props.data;
    console.log("data extraida a pintar posts: ",data);
  return (
    <>
        <div className="post-title">
            <h2> {data.title} </h2>
        </div>
        <div className="post-body">
            <p> {data.body} </p>
        </div>
    </>
  )
}

export default PostsDetail
